import './App.css';

function App() {
  return (
    <div className="App">
      <h1> Pom & Honey 4 Lyfe </h1>

      <div className="RegisterCustomer">
        <label> Username </label>
        <input type="text" name="username" />
        <label> Password </label>
        <input type="text" name="password" />
      </div>
    </div>
  );
}

export default App;
